import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { useRecoilState } from "recoil";
import { Admin, AdminJwt } from "../Atom/Atom";
import { Link } from "react-router-dom";
import { useEffect } from "react";
import axios from "../Axios/Axios";

function Menu() {
  const [admin, setAdmin] = useRecoilState(Admin);
  const[adminjwt,setAdminjwt]=useRecoilState(AdminJwt)
  useEffect(()=>
  {
    axios.post("/")
  },[])
  return (
    <Navbar collapseOnSelect expand="lg" bg="light" variant="dark">
      <Container>
        <Navbar.Brand style={{ color: "black" }}>AirBook</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link>
              <Link to="/admin" className="Link">
                Flight
              </Link>
            </Nav.Link>
            <Nav.Link>
              <Link to="addflight" className="Link">
                AddFlight
              </Link>
            </Nav.Link>
          </Nav>
          <Nav>
            <Nav.Link eventKey={2}>{admin.name}</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Menu;
